perCase(); // \u2705\n}\n\u041f\u0440\u0438\u0441\u0432\u043e\u0454\u043d\u043d\u044f \u0442\u0438\u043f\u0456\u0432\nlet a: any = 5;\nlet b: number = a; // \u2705\n\nlet u: unknown = 5;\nlet c: number = u; // \u274c\n\n\u041f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u043e \u0437 unknown:\nif (typeof u === "number") {\n  c = u; // \u2705\n}\n\n\u0420\u0435\u0430\u043b\u044c\u043d\u0438\u0439 \u043f\u0440\u0438\u043a\u043b\u0430\u0434 (API / JSON)\nfunction parse(data: unknown) {\n  if (typeof data === "object" && data !== null && "name" in data) {\n    return (data as { name: string }).name;\n  }\n}\n\u041d\u0435 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0439 any:\n\u0443 Redux\n\u0443 React props\n\u0443 \u0432\u0456\u0434\u043f\u043e\u0432\u0456\u0434\u044f\u0445 API\n\n\u2705 \u0412\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u043e\u0432\u0443\u0439 unknown:\n\u043f\u0440\u0438 \u0440\u043e\u0431\u043e\u0442\u0456 \u0437 JSON.parse\n\u0437 API\n\u0443 catch (error: unknown)\n\u043a\u043e\u043b\u0438 \u0442\u0438\u043f \u0440\u0435\u0430\u043b\u044c\u043d\u043e \u043d\u0435\u0432\u0456\u0434\u043e\u043c\u0438\u0439\n\n\u0420\u0435\u0430\u043b\u044c\u043d\u0438\u0439 \u043f\u0440\u0438\u043a\u043b\u0430\u0434 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f\nconst response: unknown = await fetch().json();\n\nconst name = parse(response);\n\nif (name) {\n  console.log(name.toUpperCase());\n}\n\n\u041a\u043e\u0440\u043e\u0442\u043a\u043e \u0437\u0430\u043f\u0430\u043c\u02bc\u044f\u0442\u0430\u0442\u0438:\nunknown \u2192 \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u044f\u0439 \u043f\u0435\u0440\u0435\u0434 \u0432\u0438\u043a\u043e\u0440\u0438\u0441\u0442\u0430\u043d\u043d\u044f\u043c\ntypeof data === "object" \u2192 \u0432\u0456\u0434\u0441\u0456\u044e\u0454 \u043f\u0440\u0438\u043c\u0456\u0442\u0438\u0432\u0438\ndata !== null \u2192 \u043e\u0431\u043e\u0432\u02bc\u044f\u0437\u043a\u043e\u0432\u043e! , \u0431\u043e typeof null === "object"\n"name" in data \u2192 \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u043a\u0430 \u043f\u043e\u043b\u044f\nas \u2192 \u043f\u043e\u044f\u0441\u043d\u044e\u0454 \u0442\u0438\u043f TS, \u043d\u0435 \u043f\u0435\u0440\u0435\u0432\u0456\u0440\u044f\u0454 \u0439\u043e\u0433\u043e\n',description:""},{id:13,link:"https://www.youtube.com/watch?v=nqwJDi-z738",title:"\u041d\u0430 \u0441\u0438\u043d\u0445\u0440\u043e\u043d\u043d\u0456\u0441\u0442\u044c JavaScript  [ 41:00 ]",requirements:["\u0412 \u044f\u043a\u0456\u0439 \u043f\u043e\u0441\u043b\u0456\u0434\u043e\u0432\u043d\u043e\u0441\u0442\u0456 \u0432\u0438\u0432\u0435\u0434\u0443\u0442\u044c\u0441\u044f console.log"],starterCode:"console.log('0');\n\nsetTimeout(function timeuot() {\n  console.log('1');\n}, 100);\n\nlet p = new Promise(function (resolve, reject) {\n  console.log('2');\n  resolve();\n});\n\np.then(function () {\n  console.log('3');\n});\n\nsetTimeout(function timeout() {\n  console.log('5');\n}, 0);\nconsole.log('6');",solution:"\n     // 0 2 6 3 5 1 ) \u0421\u0442\u0432\u043e\u0440\u0435\u043d\u043d\u044f \u043d\u043e\u0432\u043e\u0433\u043e  \u043f\u0440\u043e\u043c\u0456\u0441\u0443 \u0446\u0435 \u0441\u0438\u043d\u0445\u0440\u043e\u043d\u043d\u0438\u0439 \u043a\u043e\u0434\n    ",description:""},{id:14,link:"https://www.youtube.com/watch?v=nqwJDi-z738",title:"\u0420\u043e\u0437\u043a\u043b\u0430\u0441\u0442\u0438 \u043c\u0430\u0441\u0438\u0432 \u043d\u0430 \u0440\u044f\u0434\u043e\u043a \u0437 \u0434\u0456\u0430\u043f\u0430\u0437\u043e\u043d\u0430\u043c\u0438 [42:57]",requirements:["\u0412\u0445\u0456\u0434 \u043c\u0430\u0441\u0438\u0432 \u0447\u0438\u0441\u0435\u043b. \u0412\u0438\u0445\u0456\u0434 \u0440\u044f\u0434\u043e\u043a \u0437 \u0434\u0456\u0430\u043f\u0430\u0437\u043e\u043d\u043e\u043c."," \u041d\u0435\u043e\u0431\u0445\u0456\u0434\u043d\u043e \u043f\u0435\u0440\u0435\u0442\u0432\u043e\u0440\u0438\u0442\u0438 \u043e\u0442\u0440\u0438\u043c\u0430\u043d\u043d\u0438\u0439 \u043d\u0430 \u0432\u0445\u0456\u0434 \u043c\u0430\u0441\u0438\u0432 \u0432 \u0440\u044f\u0434\u043e\u043a"," \u0437\u0433\u043e\u0440\u0442\u0430\u044e\u0447\u0438 \u0441\u0443\u0441\u0456\u0434\u043d\u0456 \u043f\u043e \u0447\u0438\u0441\u043b\u043e\u0432\u043e\u043c\u0443 \u0440\u044f\u0434\u0443 \u0447\u0438\u0441\u043b\u0430 \u0432 \u0434\u0456\u0430\u043f\u0432\u0437\u043e\u043d"],starterCode:"range([1, 4, 5, 2, 3, 9, 8, 11, 0]);\nrange([1, 4, 3, 2]);\n\nfunction range(arr) {\n  // your code here\n  }",solution:"\nfunction range(arr) {\n  const sortArr = [...arr].sort((a, b) => a - b);\n  if (!sortArr.length) {\n    return '';\n  }\n\n  const result = [String(sortArr[0])];\n  let isInterval = false;\n  for (let i = 1; i <= sortArr.length; i++) {\n    const prev = sortArr[i - 1];\n    const current = sortArr[i];\n\n    if (current - prev === 1) {\n      isInterval = true;\n      continue;\n    }\n    if (isInterval) {\n      result[result.length - 1] +=  `-${prev}`;\n      isInterval = false;\n    }\n    if (current !== undefined) {\n      result.push(String(current));\n    }\n  }\n  return result.join();\n}\n console.log(range([1, 4, 5, 2, 3, 9, 8, 11, 0])); // 0-5,8-9,11\n console.log(range([1, 4, 3, 2])); // 1-4",description:""},{id:15,link:"https://www.youtube.com/watch?v=nqwJDi-z738",title:"\u0420\u043e\u0437\u043a\u043b\u0430\u0441\u0442\u0438 \u043c\u0430\u0441\u0438\u0432 \u043d\u0430 \u0440\u044f\u0434\u043e\u043a \u0437 \u0434\u0456\u0430\u043f\u0430\u0437\u043e\u043d\u0430\u043c\u0438 [42:57]",requirements:["\u0412\u0430\u0440\u0456\u0430\u043d\u0442 2"],starterCode:"range([1, 4, 5, 2, 3, 9, 8, 11, 0]);\nrange([1, 4, 3, 2]);\n\nfunction range(arr) {\n  // your code here\n  }",solution:"function range(arr) {\n  if (!arr.length) return '';\n\n  const sorted = [...arr].sort((a, b) => a - b);\n  const result = [];\n  let start = sorted[0];\n  for (let i = 1; i <= sorted.length; i++) {\n    // \u044f\u043a\u0449\u043e \u043a\u0456\u043d\u0435\u0446\u044c \u043f